webpackJsonp([0x6e70aa9de983],{732:function(a,e){a.exports={data:{markdownRemark:{html:'<p>The dashboard provides information on various metrics of your program. This helps you track the progress of your program and it also gives you a detailed summary and understanding of the status of your program.  </p>\n<p>HackerOne provides these 3 different dashboards:</p>\n<ul>\n<li>Overview</li>\n<li>Program Health</li>\n<li><a href="hacker-feedback-dashboard.html">Hacker Feedback</a></li>\n</ul>\n<p>For each dashboard, you can customize the data you see by choosing the dates you want to see the metrics for.</p>\n<h3>Overview Dashboard</h3>\n<p>The Overview dashboard enables you to view by date and graph form:</p>\n<ul>\n<li>Report statuses</li>\n<li>Response and Resolution Time</li>\n<li>Bounty Payouts</li>\n<li>The percentage of the types of bugs that are closed</li>\n</ul>\n<p>You can also view the breakdown of all reports by severity.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-2da2c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50.83565459610028%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-2f183.png"\n        srcset="/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-67829.png 125w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-5c59f.png 250w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-2f183.png 500w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-c93e8.png 750w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-4e628.png 1000w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-b3ac4.png 1500w,\n/static/dashboards-1-e0ea9020502d5a2f49374be6a0969f29-2da2c.png 2872w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Program Health Dashboard</h3>\n<p>The program health dashboard gives insight into how efficiently you respond to your reports. It helps you keep track of how many reports have missed your <a href="response-targets.html">response target</a> or standard.</p>\n<p>You can view the metrics of the average time to:</p>\n<ul>\n<li>First response</li>\n<li>Triage</li>\n<li>Bounty</li>\n<li>Resolution</li>\n</ul>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-61dd9.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 48.09052333804809%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="image"\n        title=""\n        src="/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-2f183.png"\n        srcset="/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-67829.png 125w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-5c59f.png 250w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-2f183.png 500w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-c93e8.png 750w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-4e628.png 1000w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-b3ac4.png 1500w,\n/static/dashboards-2-9d958a999d4119a568f3cf18266989c5-61dd9.png 2828w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{path:"/programs/dashboards.html",id:"programs/dashboards",title:"Dashboards",description:null}}},pathContext:{}}}});
